import React from "react";
import Container from "../components/Container";
import Row from "../components/Row";
import Col from "../components/Col";

function Portfolio() {
  return (
    <div>
      <Container style={{ marginTop: 30 }}>
        <Row>
          <Col size="md-12">
            <h1>About me...</h1>
          </Col>
        </Row>
        <Row>
          <Col size="md-12">
            <p>
              Here we go
            </p>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Portfolio;
